        [bold]Crew Member:[/bold] [color=darkred]They're out there, I know it... watching, waiting. It's not paranoia if they're really out to get you, right? Ha... right. The Captain, the Core, it's all connected. They said I was just a mechanic, but I see the strings, the puppeteers hands...[/color]


        [italic]Sounds of shuffling, perhaps the person is shifting within a confined space, their voice echoing off close walls.[/italic]


        [bold]Crew Member:[/bold] [color=darkred]Water's gone. Sips, just sips to make it last, but it's not lasting, is it? Lips are cracked, throat's a desert. Gotta... gotta stay quiet. If they hear, they'll come. But I can't just... I can't leave. Cant trust the taps, they've poisoned the supplies. Cant trust anyone.[/color]


        [italic]A pause, followed by a soft, self-mocking laugh.[/italic]


        [bold]Crew Member:[/bold] [color=darkred]Holed up in here with wrenches and wires, my fortress of solitude. Ha! Fortress of solitude, my ass. Its a tomb. They think they can starve me out, but I wont let them take me. I wont be another pawn, another... casualty.[/color]


        [italic]A sudden loud bang, perhaps a fist against metal, then a hiss of pain.[/italic]


        [bold]Crew Member:[/bold] [color=darkred]There it is again, that sound. Is it them? No, no, just my head, playing tricks. It's just me here. Me and the shadows... and the whispers. They whisper, you know? About the core, about how it hungers...[/color]


        [italic]The voice grows quieter, a whisper itself now.[/italic]


        [bold]Crew Member:[/bold] [color=darkred]But I won't give in, I wont be fodder for that... that thing. I've got to get out, got to warn... someone. Anyone. But not yet, not yet. It's not safe...[/color]


        [italic]The recording continues, but only the sound of shallow, rapid breathing is discernible. The crew members voice does not rise again before the audio cuts out.[/italic]


        [italic]End of Monologue[/italic]
