        [head=3][color=red]Central Command Security Testing Notice[head/]


        [color=black]

        This station is being supplied with an experimental system for prisoners in permanent confinement. A Nitrous Oxide Canister has been supplied to, in the event of emergency, force prisoners in permanent confinement to sleep.


        The canister and the pipe system can be found behind the central security office. Below is an explanation of all the systems required to operate it correctly.


        [bold]Adding The Gas To Permanent Confinement[/bold]

        To add the gas to the rooms, wrench down the Nitrous Oxide canister and then activate the signal button, which will disable the atmospherics scrubbers inside of the room. After the scrubbers have been disabled, you may turn on the pump to send in the gas.


        [bold]Removing The Gas From Permanent Confinement[/bold]

        After the gas has been added to the rooms, you will need to reactivate the standard atmospheric scrubbers to remove it. To do so, simply hit the signal button again. It is recommended that after the Nitrous Oxide canister is used, its remaining moles are checked.
