    - type: Paper
      content: >-
        [italic]Personal Log - Crew Member G.H.[/italic]


        ---


        [italic]Theyre coming. I can hear the whispers through the bulkheads, in the clatter of every vent, echoing in the very hum of the station itself. Can't trust the water from the taps anymore, they've touched that too, I know it. Its just a matter of time before they come for me.[/italic]


        [italic]My holdout wont last. Ive fortified myself in Storage Room 3, behind crates of nutrient paste and powdered eggs. My barricade is solid, but whats solid anymore? The walls feel like illusions. They change when I'm not looking. They're alive.[/italic]


        [italic]I've been sipping the last of my water rations. My tongue's turned to sandpaper, the taste of metal taints my mouth, and the air... the air is getting thicker. Each breath is a struggle, feels like I'm drawing air through a straw, a thin, crumpled straw. Theyre trying to suffocate me, I know it. But I won't let them. I won't.[/italic]


        [italic]The comms been silent for hours, or is it days now? Time's twisted here, dancing to a tune I cant hear. I tap into the feed, and all I get is static. Static or screams. Or are the screams just the static talking to me? They tell me things. Horrible things.[/italic]


        [italic]But I wont go. I can't. They wont take me to where the others went, not to that darkness beyond the stars. I've seen it in dreams, that gaping maw of endless night, where stars dont dare shine. Thats where they drag you when they catch you looking away. Not me.[/italic]


        [italic]They think they can starve me out, scare me out. But this room has become my world, my universe. A small universe running out of water, true, but a fortress all the same. My fortress. My rules. My...[/italic]


        [italic]Wait. I hear something. The seal on the door hissed. Its just the life support cycling, it has to be. But no. There's a pattern to it. A voice? No, voices. They're whispering my name. They're here. They're[/italic]


        [italic]End of Entry[/italic]
